import React from 'react';
import './Home.css';
import Logo from './Logo';

export default function Home() {
  return (
    <div style={{position: 'relative', minHeight: '100vh'}}>
      <div style={{position: 'absolute', top: 32, left: 32, zIndex: 10}}>
        <Logo />
      </div>
    </div>
  );
}
